                  style={{ border: 0 }}
                  allowFullScreen=""
                  loading="lazy"
                ></iframe>
              </div>
            </div>
          </div>

          {/* Contact Form */}
          <div className="col-lg-7">
            <div
              className="p-4 rounded-4 shadow-lg border-0"
              style={{
                background: "rgba(255, 255, 255, 0.95)",
